import React, { Component } from 'react'

class Results extends Component {
  render() {
    return (
      <main className="container">
        <div className="row">
          <div className="col-md-6">
            {results}
          </div>
          <div className="col-md-6">
            <div className="play-box">
              {iframtoplay}
              {videoTitle}
            </div>

          </div>
        </div>

      </main>
    );
  }
}
export default Results
